        <div class="box">Word 1</div>
        <div class="box">Word 2</div>
        <div class="box">Word 3</div>
        <div class="box">Word 4</div>
        <div class="box">Word 5</div>
        <div class="box">Word 6</div>
        <div class="box">Word 7</div>
        <div class="box">Word 8</div>
        <div class="box">Word 9</div>
        <div class="box">Word 10</div>
        <div class="box">Word 11</div>
        <div class="box">Word 12</div>
        <div class="box">Word 13</div>
        <div class="box">Word 14</div>
        <div class="box">Word 15</div>
        <div class="box">Word 16</div>
        <div class="box">Word 17</div>
        <div class="box">Word 18</div>
        <div class="box">Word 19</div>
        <div class="box">Word 20</div>
        <div class="box">Word 21</div>
        <div class="box">Word 22</div>
        <div class="box">Word 23</div>
        <div class="box">Word 24</div>
        <div class="box">Word 25</div>
    </div>
    </body>

    </div>
    );
};

export default CodeNames;
